css:
atom-text-editor,
:host {
  background-color: #1d1f21;
  color: #c5c8c6;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #282a2e;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #373b41;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #373b41;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #282a2e;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #373b41;
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #c5c8c6;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #969896;
}
atom-text-editor .invisible,
:host .invisible {
  color: #c5c8c6;
}
atom-text-editor .cursor,
:host .cursor {
  color: #ffffff;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #404349;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #969896;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #969896;
}
.entity.name.type {
  color: #f0c674;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #b5bd68;
}
.keyword {
  color: #b294bb;
}
.keyword.control {
  color: #b294bb;
}
.keyword.operator {
  color: #c5c8c6;
}
.keyword.other.special-method {
  color: #81a2be;
}
.keyword.other.unit {
  color: #de935f;
}
.storage {
  color: #b294bb;
}
.constant {
  color: #de935f;
}
.constant.character.escape {
  color: #8abeb7;
}
.constant.numeric {
  color: #de935f;
}
.constant.other.color {
  color: #8abeb7;
}
.constant.other.symbol {
  color: #b5bd68;
}
.variable {
  color: #cc6666;
}
.variable.interpolation {
  color: #bf4040;
}
.variable.parameter.function {
  color: #c5c8c6;
}
.invalid.illegal {
  background-color: #cc6666;
  color: #1d1f21;
}
.string {
  color: #b5bd68;
}
.string.regexp {
  color: #8abeb7;
}
.string.regexp .source.ruby.embedded {
  color: #de935f;
}
.string.other.link {
  color: #cc6666;
}
.punctuation.definition.comment {
  color: #969896;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c5c8c6;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #81a2be;
}
.punctuation.definition.bold {
  color: #f0c674;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #b294bb;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #bf4040;
}
.support.class {
  color: #f0c674;
}
.support.function {
  color: #8abeb7;
}
.support.function.any-method {
  color: #81a2be;
}
.entity.name.function {
  color: #81a2be;
}
.entity.name.class,
.entity.name.type.class {
  color: #f0c674;
}
.entity.name.section {
  color: #81a2be;
}
.entity.name.tag {
  color: #cc6666;
  text-decoration: underline;
}
.entity.other.attribute-name {
  color: #de935f;
}
.entity.other.attribute-name.id {
  color: #81a2be;
}
.meta.class {
  color: #f0c674;
}
.meta.link {
  color: #de935f;
}
.meta.require {
  color: #81a2be;
}
.meta.selector {
  color: #b294bb;
}
.meta.separator {
  background-color: #373b41;
  color: #c5c8c6;
}
.none {
  color: #c5c8c6;
}
.markup.bold {
  color: #de935f;
  font-weight: bold;
}
.markup.changed {
  color: #b294bb;
}
.markup.deleted {
  color: #cc6666;
}
.markup.italic {
  color: #b294bb;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #81a2be;
}
.markup.inserted {
  color: #b5bd68;
}
.markup.list {
  color: #cc6666;
}
.markup.quote {
  color: #de935f;
}
.markup.raw.inline {
  color: #b5bd68;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #b5bd68;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
atom-text-editor,
:host {
  background-color: #282c34;
  color: #f0f0f0;
}
.selection .region {
  background-color: rgba(93, 174, 165, 0.15);
}
.wrap-guide {
  background: transparent !important;
}
.string {
  color: #c08c48;
}
.property-value {
  color: #c08c48;
}
.keyword {
  color: #c08c48 !important;
}
.constant {
  color: #c08c48 !important;
}
.important {
  color: #88C7FF !important;
}
.property-name {
  color: #f0f0f0;
}
.punctuation.terminator {
  color: #5daea5;
}
.punctuation.separator {
  color: #5daea5;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  border-color: #5daea5;
}
@-webkit-keyframes bracketanimation {
  from {
    border-width: 2px;
    border-color: #5daea5;
  }
  75% {
    border-width: 2px;
    border-color: #5daea5;
  }
  to {
    border-width: 1px;
    border-color: #5daea5;
  }
}
.bracket-matcher .region {
  border-bottom: 0;
}
.bracket-matcher .region:after {
  content: "";
  -webkit-animation-name: bracketanimation;
  -webkit-animation-duration: .2s;
  border: 1px solid #5daea5;
  border-style: solid;
  border-radius: 2px;
  background-color: rgba(255, 255, 255, 0.1);
  width: 100%;
  height: 95%;
  position: absolute;
}
.list-tree li.list-nested-item > .list-item {
  color: #E4E4E4 !important;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li {
  color: #5daea5;
  font-family: Arial;
}
.tree-view {
  font-size: 1em;
  background: #282C34 !important;
}
.tree-view .selected:before {
  background: none !important;
  border: solid 1px rgba(255, 255, 255, 0.34);
  left: 30px;
}
.entity.other.attribute-name {
  color: #5daea5;
}
.entity.other.attribute-name.id {
  color: #C2CA80;
}
.entity.other.attribute-name.class {
  color: #5daea5;
}
.entity.name.tag {
  text-decoration: none;
}
